createApp({data(){return{userName:"",password:"",isLoading:!0}},methods:{async login(){if(this.userName.length==0||this.password.length==0){UiHelpers.showErrorToast("Validation Failure","","Missing user name and/or password");return}var n=this;this.isLoading=!0;let t={userName:this.userName,password:this.password},i=await axios.post("/api/login",t).then(function(){window.location.href="/dashboard"}).catch(function(t){t.request.status==401?UiHelpers.showErrorToast("Login Failure","","Invalid user name/password"):UiHelpers.showErrorToast("Error","","An unexpected error occurred trying to log you in");n.isLoading=!1})}},mounted:function(){this.isLoading=!1;document.getElementById("login-username").focus()}}).mount("#app-login");